CREATE TABLE NhanVien
(
    idNhanVien int         NOT NULL
        PRIMARY KEY,
    hoTen      varchar(45) NULL,
    idViTri    int         NULL,
    idTrinhDo  int         NULL,
    idBoPhan   int         NULL,
    ngaySinh   date        NULL,
    soCMND     varchar(45) NULL,
    luong      int         NULL,
    sdt        varchar(45) NULL,
    email      varchar(45) NULL,
    diaChi     varchar(45) NULL,
    CONSTRAINT NhanVien_soCMND_uindex
        UNIQUE (soCMND),
    CONSTRAINT NhanVien_ibfk_1
        FOREIGN KEY (idViTri) REFERENCES ViTri (idViTri),
    CONSTRAINT NhanVien_ibfk_2
        FOREIGN KEY (idTrinhDo) REFERENCES TrinhDo (idTrinhDo),
    CONSTRAINT NhanVien_ibfk_3
        FOREIGN KEY (idBoPhan) REFERENCES BoPhan (idBoPhan)
);

CREATE INDEX idBoPhan
    ON NhanVien (idBoPhan);

CREATE INDEX idTrinhDo
    ON NhanVien (idTrinhDo);

CREATE INDEX idViTri
    ON NhanVien (idViTri);

